# Problem:
# https://leetcode.com/problems/largest-1-bordered-square/

import numpy as np

class Solution:
    def largest1BorderedSquare(self, grid):
        '''
        Author: Wenzhi Ding

        Runtime: 3,268ms (5%)---Stupid answer
        Memory: 29.8MB (5%)
        '''
        g = np.array(grid)
        if g.sum() == 0:  # If no 1 in matrix, return 0
            return 0
        for i in range(min(g.shape), 1, -1):
            # i is the length/width of kernel
            # no need to loop kernel with size=1
            kernel = np.ones((i, i))
            kernel[1:i - 1, 1:i - 1] = 0
            tot = i ** 2 - (i - 2) ** 2
            for j in range(g.shape[0] - i + 1):
                for k in range(g.shape[1] - i + 1):
                    if g[j:j + i, k:k + 1].sum() < i:  # cut branch
                        continue
                    if g[j:j + 1, k:k + i].sum() < i:  # cut branch
                        continue
                    if (g[j:j + i, k:k + i].sum() < tot):  # cut branch
                        continue
                    if ((g[j:j + i, k:k + i] * kernel).sum() == tot):
                        return i ** 2
        return 1

